import getBooksList from './getBooksList';

export default async (req, res) => {
  res.statusCode = 200;
  const bookList = await getBooksList();
  console.log(`req--->${req.body}`);
  console.log(`bookList--->${bookList}`);
  res.json({ 
    data: 'Borrowed succesfully'
  });
}
